import React, { useEffect } from "react";

import {ItensMenu} from "./ItensMenu";

const NavigationMenu = props => {

    useEffect(() => {
        console.log(props.logged);
    });

    return (
        <nav>
            <ul>
                {ItensMenu.map((item, idx) => {
                    return (
                        <li key={idx}>
                            <a href={item.link}>
                                {item.name}
                            </a>
                        </li>
                    )
                })}
            </ul>
        </nav>
    )
}

export default NavigationMenu;
